import React from 'react';
import ReactDOM from 'react-dom';

import './index.css';

import Header from './Components/Header/HeaderComponent'
import App from './App'
import Overlay from './Components/UI/Overlay'
import MenuLeft from './Components/Main/MenuLeft'

ReactDOM.render(<Header />,document.getElementById('header'));
ReactDOM.render(<App />,document.getElementById('mainSection'));
ReactDOM.render(<Overlay />,document.getElementById('overlay'));
ReactDOM.render(<MenuLeft />,document.getElementById('menuLeft'));
